import React from 'react';



const ButtonList = ()=>{
    return(
        <li className="list-view" role="presentation">
        <a id="list-view-tab" data-bs-toggle="tab" href="#list-view" role="tab" aria-selected="true">
          <i className="fa fa-th-list" />
        </a>
      </li>
    )
}

export default ButtonList;
